                                           setCRn(5, (getBit(CRM, 2) ? getCRn(5) : getBits(rS, (2 * 4) + 3, (2 * 4) + 0)));
                                           setCRn(6, (getBit(CRM, 1) ? getCRn(6) : getBits(rS, (1 * 4) + 3, (1 * 4) + 0)));
                                           setCRn(7, (getBit(CRM, 0) ? getCRn(7) : getBits(rS, (0 * 4) + 3, (0 * 4) + 0))); }
